//Card solo renderiza lo que yo necesito
import React from "react";
import './styles/Card.css'; // importo los styles de mi Card.css

export default function Card({numexpediente, fechainicioentrada, adrema, estado, iniciadornomyape }){ // platform
    
    // var genre2= []
    // if (genre) { 
    //     Array.isArray(genre)     
    return (
        <div> 
            <div class="detailcontainerlist">
            <div class="header"> 
                <h2 class="heading">EXPEDIENTE:</h2>
                <h2 class="headingRojo">{numexpediente}</h2>
            </div>
             
            <h2 class="heading">ADREMA: </h2> 
            <h2 class="headingRojo">{adrema}</h2>  
            <h2 class="heading">INICIO ENTRADA: </h2> 
            <h2 class="headingRojo">{fechainicioentrada}</h2> 
            <h2 class="heading">ESTADO: </h2>
            <h2 class="headingRojo">{estado}</h2> 
            <h2 class="heading">INICIADOR: </h2>
            <h2 class="headingRojo">{iniciadornomyape}</h2>           
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQnyWAaTFapVC--3RYbSrGnlOPepq00cPmRZw&usqp=CAU" alt="img not found" width = "200px" height="100px"/>
            <h5> ----------------------------------------------------------------- </h5>
            </div>
        </div>)
}


